import React, { Fragment } from 'react'
import FoodItems from './FoodItems'
import Form from './Form'

const FoodAddList = () => {
  return (
    <Fragment>
      <FoodItems />
      <Form />
    </Fragment>
  )
}

export default FoodAddList
